import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      id: "e1",
      title: "car insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e2",
      title: "car installment",
      amount: 5294.67,
      date: new Date(2021, 2, 9),
    },
    {
      id: "e3",
      title: "car fix",
      amount: 2394.67,
      date: new Date(2021, 2, 2),
    },
    {
      id: "e4",
      title: "car oil",
      amount: 194.67,
      date: new Date(2021, 2, 1),
    },
  ];

  return (
    <div>
      <h2>Let's get started! wow</h2>
      <ExpenseItem
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[1].title}
        amount={expense[1].amount}
        date={expense[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[2].title}
        amount={expense[2].amount}
        date={expense[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[3].title}
        amount={expense[3].amount}
        date={expense[3].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
